div.div:
Движение частицы
Вход:
pos - массив координат частицы по x, y, z;
vel - массив скоростей частицs по направлениям x, y, z;
age - текущее время жизни частицы;
maxAge - максимальное время жизни частицы;
color - цвет частицы
noise - функция принимающая координаты частицы и возвращающая массив шумовых скоростей.
Выход: новое положение частицы в пространстве
